class cDeviceSettings:
    def __init__(self, oInterFace: cInterface, oSetting: cBaseInterFaceSettings):
        # We set some default values to assure that the some system vars has been set

        self.oInterFace: cInterface = oInterFace
        self.oSetting: cBaseInterFaceSettings = oSetting
        self.uVar_MacAdress: str            = '000000000000'
        self.uVar_Brand: str                = 'Unknown'
        self.uVar_Category: str             = 'Unknown'
        self.uVar_DeviceName: str           = 'Unknown'
        self.uVar_Year: str                 = 'Unknown'
        self.uVar_Destination: str          = 'Unknown'
        self.uVar_Model: str                = 'Unknown'
        self.uVar_ModelIconUrl: str         = ''
        self.uVar_FriendlyName: str         = 'Unknown'
        self.uVar_FirmwareVersion: str      = 'Unknown'
        self.dVar_NetService: Dict          = {'1': {'id': '0e', 'name': 'TuneIn Radio'}}
        self.dVar_Sources: Dict             = {'1': {'id': '10', 'name': 'BD/DVD'}}
        self.dVar_ListeningModes: Dict      = {'1': {'code': 'MUSIC', 'name': 'Music'}}
        self.dVar_Presets: Dict             = {'1': {'id': '01', 'name': 'Unknown'}}
        self.uVar_Bass_Max: str             = ''
        self.uVar_Bass_Min: str             = ''
        self.uVar_CenterLevel_Max: str      = ''
        self.uVar_CenterLevel_Min: str      = ''
        self.uVar_CTLFormat: str            = ''
        self.uVar_CTLMax: str               = ''
        self.uVar_CTLMin: str               = ''
        self.uVar_SubWooferLevel_Max: str   = ''
        self.uVar_SubWooferLevel_Min: str   = ''
        self.uVar_SWLFormat: str            = ''
        self.uVar_SWLMax: str               = ''
        self.uVar_SWLMin: str               = ''
        self.uVar_Treble_Max: str           = ''
        self.uVar_Treble_Min: str           = ''
        self.dCapability: Dict              = dDeviceCaps['TX-NR676E']

    def ParseXML(self, uXML: str, oAction: cAction) -> bool:
        try:
            iPos: int
            oXML: Element
            oXMLControlList: Optional[Element]
            oXMLNetServices: Optional[Element]
            oXMLPresets: Optional[Element]
            oXMLSources: Optional[Element]
            oXMLControls: Optional[Element]
            uID: str
            uZone: str

            oXML                                = LoadXMLString(uXML=uXML).find('device')


            self.uVar_MacAdress                 = GetXMLTextValue(oXMLNode=oXML,        uTag='macaddress',      bMandatory=False, vDefault='Unknown')
            self.uVar_Brand                     = GetXMLTextValue(oXMLNode=oXML,        uTag='brand',           bMandatory=False, vDefault='Unknown')
            self.uVar_Category                  = GetXMLTextValue(oXMLNode=oXML,        uTag='category',        bMandatory=False, vDefault='Unknown')
            self.uVar_DeviceName                = GetXMLTextAttributeVar(oXMLNode=oXML, uTag='id',              bMandatory=False, uDefault='Unknown')
            self.uVar_Year                      = GetXMLTextValue(oXMLNode=oXML,        uTag='year',            bMandatory=False, vDefault='Unknown')
            self.uVar_Destination               = GetXMLTextValue(oXMLNode=oXML,        uTag='destination',     bMandatory=False, vDefault='Unknown')
            self.uVar_Model                     = GetXMLTextValue(oXMLNode=oXML,        uTag='model',           bMandatory=False, vDefault='Unknown')
            self.uVar_ModelIconUrl              = GetXMLTextValue(oXMLNode=oXML,        uTag='modeliconurl',    bMandatory=False, vDefault='')
            self.uVar_FriendlyName              = GetXMLTextValue(oXMLNode=oXML,        uTag='friendlyname',    bMandatory=False, vDefault='Unknown')
            self.uVar_FirmwareVersion           = GetXMLTextValue(oXMLNode=oXML,        uTag='firmwareversion', bMandatory=False, vDefault='Unknown')

            oXMLControlList = oXML.find('controllist')
            if oXMLControlList is not None:
                for oControlElement in oXMLControlList:
                    uID = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='id', bMandatory=False, vDefault='')
                    # print (uID)
                    if uID == 'Bass':
                        uZone = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='zone', bMandatory=False, vDefault='')
                        if uZone == '1':
                            self.uVar_Bass_Min = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='min', bMandatory=False, vDefault='-10')
                            self.uVar_Bass_Max = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='max', bMandatory=False, vDefault='+10')
                    if uID == 'Treble':
                        uZone = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='zone', bMandatory=False, vDefault='')
                        if uZone == '1':
                            self.uVar_Treble_Min = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='min', bMandatory=False, vDefault='-10')
                            self.uVar_Treble_Max = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='max', bMandatory=False, vDefault='+10')
                    if uID == 'Center Level':
                        uZone = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='zone', bMandatory=False, vDefault='')
                        if uZone == '1':
                            self.uVar_CenterLevel_Min = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='min', bMandatory=False, vDefault='-12')
                            self.uVar_CenterLevel_Max = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='max', bMandatory=False, vDefault='+12')
                    if uID == 'Subwoofer Level':
                        uZone = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='zone', bMandatory=False, vDefault='')
                        if uZone == '1':
                            self.uVar_SubWooferLevel_Min = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='min', bMandatory=False, vDefault='-15')
                            self.uVar_SubWooferLevel_Max = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='max', bMandatory=False, vDefault='+12')

            oXMLNetServices = oXML.find('netservicelist')
            self.dVar_NetService.clear()
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_NetService_id[]')
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_NetService_name[]')
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_NetService_value[]')
            if oXMLNetServices is not None:
                iPos = 0
                for oNetServiceElement in oXMLNetServices:
                    uID = GetXMLTextAttribute(oXMLNode=oNetServiceElement,    uTag='id',    bMandatory=False, vDefault='')
                    uName = GetXMLTextAttribute(oXMLNode=oNetServiceElement,  uTag='name',  bMandatory=False, vDefault='')
                    uValue = GetXMLTextAttribute(oXMLNode=oNetServiceElement, uTag='value', bMandatory=False, vDefault='')
                    if uID and uValue == '1':
                        iPos += 1
                        self.dVar_NetService[str(iPos)] = {'id': uID, 'name': uName}

            oXMLPresets= oXML.find('presetlist')
            # <preset id='01' band='0' freq='0' name='' />
            self.dVar_Presets.clear()
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_Presets_id[]')
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_Presets_name[]')
            if oXMLPresets is not None:
                iPos = 0
                for oPresetElement in oXMLPresets:
                    uID   = GetXMLTextAttribute(oXMLNode=oPresetElement, uTag='id',   bMandatory=False, vDefault='')
                    uName = GetXMLTextAttribute(oXMLNode=oPresetElement, uTag='name', bMandatory=False, vDefault='')
                    if uID and uName != '':
                        iPos += 1
                        self.dVar_Presets[str(iPos)] = {'id': uID, 'name': uName}

            oXMLSources = oXML.find('selectorlist')
            self.dVar_Sources.clear()
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_Sources_id[]')
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_Sources_name[]')
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_Sources_value[]')
            if oXMLSources is not None:
                iPos = 0
                for oSourceElement in oXMLSources:
                    uID    = GetXMLTextAttribute(oXMLNode=oSourceElement, uTag='id',    bMandatory=False, vDefault='')
                    uName  = GetXMLTextAttribute(oXMLNode=oSourceElement, uTag='name',  bMandatory=False, vDefault='')
                    uValue = GetXMLTextAttribute(oXMLNode=oSourceElement, uTag='value', bMandatory=False, vDefault='')
                    if uID and uValue == '1':
                        iPos += 1
                        self.dVar_Sources[str(iPos)] = {'id': uID, 'name': uName}

            oXMLControls = oXML.find('controllist')
            self.dVar_ListeningModes.clear()
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_ListeningModes_id[]')
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_ListeningModes_name[]')
            Var_DelArray(uVarName=oAction.uGlobalDestVar + '_ListeningModes_code[]')
            if oXMLControls is not None:
                iPos = 0
                for oControlElement in oXMLControls:
                    uID    = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='id',    bMandatory=False, vDefault='')
                    uValue = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='value', bMandatory=False, vDefault='')
                    uCode  = GetXMLTextAttribute(oXMLNode=oControlElement, uTag='code',  bMandatory=False, vDefault='')
                    if uID.startswith('LMD ') and uValue == '1':
                        iPos += 1
                        self.dVar_ListeningModes[str(iPos)] = {'code': uCode, 'name': uID[4:]}

            dCapability:Dict = dDeviceCaps.get(self.uVar_Model,dDeviceCaps['TX-NR900'])
            if dCapability is not None:
                if self.uVar_SWLFormat == '' : self.uVar_SWLFormat = dCapability['SWLFORMAT']
                if self.uVar_SWLMin    == '' : self.uVar_SWLMin    = dCapability['SWLMIN']
                if self.uVar_SWLMax    == '' : self.uVar_SWLMax    = dCapability['SWLMAX']
                if self.uVar_CTLFormat == '' : self.uVar_CTLFormat = dCapability['CTLFORMAT']
                if self.uVar_CTLMin    == '' : self.uVar_CTLMin    = dCapability['CTLMIN']
                if self.uVar_CTLMax    == '' : self.uVar_CTLMax    = dCapability['CTLMAX']

                if self.uVar_SubWooferLevel_Max == '' : self.uVar_SubWooferLevel_Max=self.uVar_SWLMax
                if self.uVar_SubWooferLevel_Min == '' : self.uVar_SubWooferLevel_Min=self.uVar_SWLMin
                if self.uVar_CenterLevel_Max    == '' : self.uVar_CenterLevel_Max=self.uVar_CTLMax
                if self.uVar_CenterLevel_Min    == '' : self.uVar_CenterLevel_Min=self.uVar_CTLMin

                self.dCapability = dCapability

            return True
        except Exception as e:
            self.oInterFace.ShowError(uMsg='Error parsing NRI (Device Information) response', oException=e)
            return False

    # noinspection PyUnusedLocal
    def WriteVars(self, uVarPrefix:str, oAction:cAction) -> None:

        # todo: Check usage of uVarPrefix

        uValue: str
        uKey: str
        uSubKey: str
        uAttributName: str
        iIdx: int
        dDict:Dict

        if self.oSetting.oResultParser is None:
            self.oSetting.oResultParser = cInterFaceResultParser(self.oInterFace, self.oSetting.uConfigName)
            self.oSetting.oResultParser.uGlobalParseResultOption = self.oSetting.aIniSettings.uParseResultOption
            self.oSetting.oResultParser.uGlobalTokenizeString = self.oSetting.aIniSettings.uParseResultTokenizeString

        for uAttributName in self.__dict__:
            if uAttributName.startswith('uVar_'):
                uValue = self.__dict__[uAttributName]
                self.oSetting.oResultParser.SetVar2(uValue, oAction.uLocalDestVar, oAction.uGlobalDestVar, 'Storing Device Configuration', uAddName='_' + uAttributName[5:])
            if uAttributName.startswith('dVar_'):
                dDict = self.__dict__[uAttributName]
                for uKey in dDict:
                    for uSubKey in dDict[uKey]:
                        uValue = dDict[uKey][uSubKey]
                        self.oSetting.oResultParser.SetVar2(uValue, oAction.uLocalDestVar, oAction.uGlobalDestVar, 'Storing Device Configuration', uAddName='_%s_%s[%s]' %(uAttributName[5:],uSubKey,uKey))

        iIdx = 0
        if self.dCapability is not None:
            for uKey in self.dCapability['ListeningModes']:
                self.oSetting.oResultParser.SetVar2(uKey, oAction.uLocalDestVar, oAction.uGlobalDestVar, 'Storing Listening Mode', uAddName='_ListeningMode_key[' + str(iIdx) + ']')
                self.oSetting.oResultParser.SetVar2(self.oInterFace.dLMD_Text[uKey], oAction.uLocalDestVar, oAction.uGlobalDestVar, 'Storing Listening Mode', uAddName='_ListeningMode_name[' + str(iIdx) + ']')
                iIdx += 1
